        'The Forgotten Heroes 14-19 Foundation is the producer of this Pop Up exhibition based upon their book "The Unknown Fallen ".\nIt is one of those exhibitions where powerful pictures and graphics predominantly tell more stories than the written words. There are indeed few words written in this pop up exhibition, but there are personal individual introductions, little stories, incidents and some transcripts/translations of documents and personal letters – the rest is powerful images and graphics.\nWhether we agree or disagree with the reasons, purpose and causes of the First World War, that’s a separate matter; this exhibition focuses on and reflects upon a powerful message of how a diverse force of many nationalities, faiths, ethnicities and genders built unity, friendship and respect in an incredibly hostile environment.\nIt is unfortunate that after 100 years we are still fighting for the value of equality and diversity in our society. In some areas, society seems to have gone backwards, hence prompting a pressing need to share a positive message from this era of our history. We should indeed learn from the past, not live in it.\nLatest Breaking news! The Forgotten Heroes 14-19 Foundation has just been chosen as an Awarded Project under the category “Peace & Reconciliation “ by Faith & Belief Forum and Her Majesty’s Lord Lieutenant of Greater London’s Council on Faith.\n\nThe Unknown Fallen website: https://unknownfallen.com/\nThe Muslims in WW1 experience: http://muslimsinww1.com/',
