      html:
        '<H2><STRONG>A Creative Approach to the Prevent Duty &amp; British Values</STRONG></H2>\r\n<H3>FREE WORKSHOPS FOR PRIMARY SCHOOLS</H3>\r\n<H3><STRONG>*Please note - this booking form is for INVITED schools only. If you have not received an invite, please contact us prior to making a booking*</STRONG></H3>\r\n<H3> </H3>\r\n<H3>An exhibition and workshop has been designed by the Peace Museum to explore themes relating to the choices people make in times of conflict.</H3>\r\n<P>Delivered in your own school setting with a dynamic touring exhibtion and workshop programme, these sessions are the ideal way to engage your students in debates around the Prevent agenda and cover themes such as propaganda, the influence of the media, democracy and the law and current political events.</P>\r\n<P>During a guided tour of the exhibition, which uses WW1 as a starting point, students are asked to explore what courage means, what influences our decisions, and discover those who joined up to serve their country and those who spoke out for peace in times of conflict.</P>\r\n<P>Following the tour, a practical workshop with students brings the topics into the present day, exploring the world today and how we can open up dialogues and respond to the threat of extremism. </P>\r\n<P><SPAN>Choices also has a range of resources for teachers and group leaders to follow on this work </SPAN><SPAN>across the curriculum, engaging studetns in relevant and thought provoking debate. </SPAN></P>\r\n<P><SPAN>Choices is an innovative and creative approach to the delivery of the Prevent Duty designed for </SPAN><SPAN>primary, secondary and further education which has been identified as a model of Best Practice by the </SPAN><SPAN>Prevent team at the Home Office and is now being rolled out across the UK.</SPAN></P>\r\n<P>The Peace Museum is delighted to be able to offer invited schools and groups from Manchester FREE sessions.</P>\r\n<P><STRONG>FAQs</STRONG></P>\r\n<P><STRONG>How many workshops can I book?</STRONG></P>\r\n<P>You can book up to two sessions during one day. </P>\r\n<P>Sessions last 1 hour.</P>\r\n<P><STRONG><SPAN>Which year groups should attend?<BR></SPAN></STRONG>Sessions are designed for Year 5 and/or Year 6.</P>\r\n<P><STRONG><SPAN>How many can be in a group?<BR></SPAN></STRONG>Each session is designed to accommodate a MAXIMUM of one class size (approx 30 students). </P>\r\n<P><STRONG><SPAN>What times will you deliver the sessions?<BR></SPAN></STRONG>Times for morning or afternoon sessions are flexible to accommodate your timetable.</P>\r\n<P>Sessions last 1 hour, but can be adapted to suit your timetable as above.</P>\r\n<P CLASS="MsoNoSpacing"><STRONG>What space would you require? <BR></STRONG>A large space, e.g. drama studio, small hall, to accommodate the exhibition.<BR>Sessions are NOT designed to be delivered in the classroom. </P>\r\n<P CLASS="MsoNoSpacing"><STRONG>Do I need to provide anything else?</STRONG><BR>A car parking space with good access for unloading the exhibition will be required.<BR>A teacher in charge of group supervision must be provided by the school.</P>\r\n<P CLASS="MsoNoSpacing"><STRONG>Are there follow up materials?</STRONG> <BR>The Peace Museum has produced a high quality Resource Pack with mid-term plans and classroom based activities. These can be purced from the Peace Museum at a cost of £19.99 each. </P>\r\n<P CLASS="MsoNoSpacing"><STRONG><SPAN>Are you DBS checked?<BR></SPAN></STRONG>The Session leader, Jude Wright, has full current DBS check. Information will be sent out as to how to access this information via the government\'s portable DBS scheme with confirmation of booking. </P>\r\n<P CLASS="MsoNoSpacing"><STRONG>Where can I contact the organiser with any questions?<BR></STRONG>Choices@peacemuseum.org.uk</P>\r\n<P><BR></P>'
